package src.com.leetcode.s567;

import java.util.Arrays;
import java.util.Objects;

class Solution {

    public static void main(String[] args) {
        Solution solution = new Solution();
        String s1
            =
            "";
        String s2
            =
            "";
        System.out.println("Example 1");
        System.out.println("Input: s1 = " + s1 + "\ns2 = " + s2);
        System.out.println("Output: (Excepted: false)" + solution.checkInclusion(s1, s2));

        s1 = "ab";
        s2 = "eidbaooo";
        System.out.println("Example 1");
        System.out.println("Input: s1 = " + s1 + ", s2 = " + s2);
        System.out.println("Output: (Excepted: true)" + solution.checkInclusion(s1, s2));

        s1 = "ab";
        s2 = "eidboaoo";
        System.out.println("Example 1");
        System.out.println("Input: s1 = " + s1 + ", s2 = " + s2);
        System.out.println("Output: (Excepted: false)" + solution.checkInclusion(s1, s2));

        s1 = "a";
        s2 = "ab";
        System.out.println("Example 1");
        System.out.println("Input: s1 = " + s1 + ", s2 = " + s2);
        System.out.println("Output: (Excepted: true)" + solution.checkInclusion(s1, s2));

        s1 = "ab";
        s2 = "a";
        System.out.println("Example 1");
        System.out.println("Input: s1 = " + s1 + ", s2 = " + s2);
        System.out.println("Output: (Excepted: false)" + solution.checkInclusion(s1, s2));
    }

    public boolean checkInclusion(String s1, String s2) {
        if (s2.length() < s1.length()) {return false;}

        int[] s1Count = new int[26];
        int[] s2Count = new int[26];
        for (int i = 0; i < s1.length(); i++) {
            s1Count[s1.charAt(i) - 'a']++;
            s2Count[s2.charAt(i) - 'a']++;
        }

        if (Arrays.equals(s1Count, s2Count)) {return true;}

        for (int i = 0; i < s2.length() - s1.length(); i++) {
            s2Count[s2.charAt(i) - 'a']--;
            s2Count[s2.charAt(i + s1.length()) - 'a']++;
            if (Arrays.equals(s1Count, s2Count)) {return true;}
        }
        return false;
    }
}